import { React, useState } from 'react';
import './Audio.css'

function Audio() {

    let [ audioFile, setAudioFile ] = useState([])



    return (
        <div className='container'>
            Hello this is audio page :)

            <div className='upload-area'>
                Upload Audio Here

                <form>
                    <input type="file" onChange={(event)=>setAudioFile(event.target.files[0])} />
                </form>

            </div>
        </div>
    )
}

export default Audio;
